import plugin from '../plugin.json';
const projects = acode.require('projects');
const alert = acode.require('alert');
class AcodePlugin {

  async init() {
    // plugin initialisation
    // const projects = acode.require('projects');

    async function addNewProject() {
      const GoprojectFiles = {
        'main.go': `package main

import "fmt"

func main() {
	fmt.Println("Hello, World!")
}`
      };

      const iconSrc = 'data:image/png;base64,';

      projects.set('go lang', async () => GoprojectFiles, iconSrc);

      // List all projects
      const projectList = projects.list();
      console.log('Project List:', projectList);

      // Get details of the newly added project
      const newProjectDetails = projects.get('newProject');
      console.log('New Project Details:', newProjectDetails);
    }
    addNewProject()
    async function addBackendProjects() {
      // Go Fiber Project Template
      const fiberProjectFiles = {
        'main.go': `package main

import (
    "github.com/gofiber/fiber/v2"
    "log"
)

func main() {
    app := fiber.New()

    // Middleware
    app.Use(func(c *fiber.Ctx) error {
        log.Printf("\\n%s %s", c.Method(), c.Path())
        return c.Next()
    })

    // Routes
    app.Get("/", func(c *fiber.Ctx) error {
        return c.JSON(fiber.Map{
            "message": "Welcome to Go Fiber API"
        })
    })

    app.Get("/api/items", func(c *fiber.Ctx) error {
        return c.JSON(fiber.Map{
            "items": []string{"item1", "item2"}
        })
    })

    log.Fatal(app.Listen(":3000"))
}`,
        'go.mod': `module fiber-app

go 1.21

require github.com/gofiber/fiber/v2 v2.52.0`,
        'README.md': `# Go Fiber Project

## Setup
1. Install dependencies: \`go mod tidy\`
2. Run the server: \`go run main.go\`

The server will start on http://localhost:3000`
      };

      // Express Project Template
      const expressProjectFiles = {
        'app.js': `const express = require('express');
const cors = require('cors');
const morgan = require('morgan');

const app = express();
const port = process.env.PORT || 3000;

// Middleware
app.use(cors());
app.use(morgan('dev'));
app.use(express.json());

// Routes
app.get('/', (req, res) => {
    res.json({ message: 'Welcome to Express API' });
});

app.get('/api/items', (req, res) => {
    res.json({ items: ['item1', 'item2'] });
});

// Error handling middleware
app.use((err, req, res, next) => {
    console.error(err.stack);
    res.status(500).json({ error: 'Something broke!' });
});

app.listen(port, () => {
    console.log(\`Server running on http://localhost:\${port}\`);
});`,
        'package.json': `{
  "name": "express-app",
  "version": "1.0.0",
  "main": "app.js",
  "scripts": {
    "start": "node app.js",
    "dev": "nodemon app.js"
  },
  "dependencies": {
    "cors": "^2.8.5",
    "express": "^4.18.2",
    "morgan": "^1.10.0"
  },
  "devDependencies": {
    "nodemon": "^3.0.2"
  }
}`,
        'README.md': `# Express Project

## Setup
1. Install dependencies: \`npm install\`
2. Run development server: \`npm run dev\`
3. Run production server: \`npm start\`

The server will start on http://localhost:3000`
      };

      // Flask Project Template
      const flaskProjectFiles = {
        'app.py': `from flask import Flask, jsonify
from flask_cors import CORS
import os

app = Flask(__name__)
CORS(app)

# Configuration
app.config['DEBUG'] = True

@app.route('/')
def home():
    return jsonify({'message': 'Welcome to Flask API'})

@app.route('/api/items')
def get_items():
    return jsonify({'items': ['item1', 'item2']})

@app.errorhandler(404)
def not_found(error):
    return jsonify({'error': 'Not found'}), 404

@app.errorhandler(500)
def server_error(error):
    return jsonify({'error': 'Server error'}), 500

if __name__ == '__main__':
    port = int(os.environ.get('PORT', 5000))
    app.run(host='0.0.0.0', port=port)`,
        'requirements.txt': `Flask==3.0.0
Flask-CORS==4.0.0
python-dotenv==1.0.0`,
        'README.md': `# Flask Project

## Setup
1. Create virtual environment: \`python -m venv venv\`
2. Activate virtual environment: 
   - Windows: \`venv\\Scripts\\activate\`
   - Unix/MacOS: \`source venv/bin/activate\`
3. Install dependencies: \`pip install -r requirements.txt\`
4. Run the server: \`python app.py\`

The server will start on http://localhost:5000`
      };

      // Define icons (base64 strings would go here)
      const fiberIconSrc = 'data:image/png;base64,...';  // Go Fiber icon
      const expressIconSrc = 'data:image/png;base64,...';  // Express icon
      const flaskIconSrc = 'data:image/png;base64,...';  // Flask icon

      // Add projects to the collection
      projects.set('go-fiber', async () => fiberProjectFiles, fiberIconSrc);
      projects.set('express', async () => expressProjectFiles, expressIconSrc);
      projects.set('flask', async () => flaskProjectFiles, flaskIconSrc);

      // List all projects
      const projectList = projects.list();
      console.log('Project List:', projectList);

      // Get details of each project
      const fiberDetails = projects.get('go-fiber');
      const expressDetails = projects.get('express');
      const flaskDetails = projects.get('flask');

      console.log('Project Details:', {
        fiber: fiberDetails,
        express: expressDetails,
        flask: flaskDetails
      });
    }

    addBackendProjects();
    alert("changes to the projects are applied")
  }
  async destroy() {
    // plugin clean up
  }
}

if (window.acode) {
  const acodePlugin = new AcodePlugin();
  acode.setPluginInit(plugin.id, async (baseUrl, $page, { cacheFileUrl, cacheFile }) => {
    if (!baseUrl.endsWith('/')) {
      baseUrl += '/';
    }
    acodePlugin.baseUrl = baseUrl;
    await acodePlugin.init($page, cacheFile, cacheFileUrl);
  });
  acode.setPluginUnmount(plugin.id, () => {
    acodePlugin.destroy();
  });
}
